        public static bool AddPlatinumChest(int i, int j, int contain = 0, bool notNearOtherChests = false, int Style = -1)
        {
            int k = j;
            while (k < Main.maxTilesY)
            {
                if (Main.tile[i, k].HasTile && Main.tileSolid[(int)Main.tile[i, k].TileType])
                {
                    int num = k;
